Este soneto fue escrito por Antonio Aparisi y Guijarro (1815-1872), político, periodista y escritor español del siglo XIX. Aparisi y Guijarro fue conocido por su ideología tradicionalista y católica, y por su labor como periodista y orador en las Cortes españolas.
